import React, { Component } from 'react';
import { Dialog, DialogActions, DialogContent, DialogTitle, DialogContentText, TextField, Button } from '@material-ui/core';
class TaskForm extends Component {
    render() {
        const {onClose, onOpenForm} = this.props;
        return (
            <Dialog open={onOpenForm} onClose={onClose} aria-labelledby="form-dialog-title">
                <DialogTitle id="form-dialog-title">Subscribe</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        To subscribe to this website, please enter your email address here. We will send updates
                        occasionally.
          </DialogContentText>
                    <TextField
                        autoFocus
                        margin="dense"
                        id="name"
                        label="Email Address"
                        type="email"
                        fullWidth
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={onClose} color="primary">
                        Cancel
          </Button>
                    <Button onClick={onClose} color="primary">
                        Subscribe
          </Button>
                </DialogActions>
            </Dialog>

        );
    }
}

export default TaskForm;
